import React, { Component } from 'react';
import {Layout, Menu, Icon, Avatar, Row, Col} from 'antd';
import 'antd/dist/antd.css';
import 'antd/dist/antd.min'
import qoobee from '../images/qoobee.jpg';

class Side extends Component{
    render(){
        return(

            <Layout style={{
                overflow: 'auto', height: '100vh', position: 'fixed', left: 0, width:'100px'
            }}
            >
                <Avatar size={80} src={qoobee} style={{margin:'10px 10px 10px 10px'}}/>
                <Menu   mode="inline" defaultSelectedKeys={['1']} >
                    <Menu.Item key="1" >
                        <Icon type="mail" />
                    </Menu.Item>
                    <Menu.Item key="2">
                        <Icon type="team" />
                    </Menu.Item>
                    <Menu.Item key="3">
                        <Icon type="setting" />
                    </Menu.Item>
                </Menu>
            </Layout>
        );
    }
}
export default Side;
